import React, { useState } from "react";
import "bootstrap/dist/css/bootstrap.min.css"; // Make sure Bootstrap is imported

const SERVICES = [
    { label: "Washing", value: "washing" },
    { label: "Trimming", value: "trimming" },
    { label: "Brushing", value: "brushing" },
    { label: "Nail Clipping", value: "nail_clipping" }
];

const Main = () => {
    const [name, setName] = useState("");
    const [date, setDate] = useState("");
    const [selectedServices, setSelectedServices] = useState([]);
    const [message, setMessage] = useState(null);

    const handleLogout = () => {
        localStorage.removeItem("token");
        window.location.reload();
    };

    const handleCheckboxChange = (service) => {
        setSelectedServices((prev) =>
            prev.includes(service)
                ? prev.filter((s) => s !== service)
                : [...prev, service]
        );
    };

    const handleSubmit = (e) => {
        e.preventDefault();
        setMessage({
            type: "success",
            text: `Appointment for ${name} on ${date}. Services: ${selectedServices.join(", ")}`
        });
        setName("");
        setDate("");
        setSelectedServices([]);
    };

    return (
        <div className="bg-light min-vh-100 d-flex flex-column">
            <nav className="navbar navbar-expand-lg navbar-dark bg-primary shadow-sm">
                <div className="container">
                    <h1 className="navbar-brand mb-0">
                        <span role="img" aria-label="dog">üêæ</span> MySite
                    </h1>
                    <button className="btn btn-outline-light" onClick={handleLogout}>
                        Logout
                    </button>
                </div>
            </nav>
            <div className="container flex-grow-1 d-flex align-items-center justify-content-center">
                <div className="col-md-6">
                    <div className="card shadow rounded p-4 mt-5">
                        <div className="text-center mb-4">
                            <img
                                src="https://cdn-icons-png.flaticon.com/512/616/616408.png"
                                alt="Dog Icon"
                                width={64}
                                className="mb-2"
                            />
                            <h2 className="card-title mb-0">Book an Appointment</h2>
                            <p className="text-muted">Let your pup shine!</p>
                        </div>
                        {message && (
                            <div className={`alert alert-${message.type} alert-dismissible fade show`} role="alert">
                                {message.text}
                                <button type="button" className="btn-close" aria-label="Close" onClick={() => setMessage(null)}></button>
                            </div>
                        )}
                        <form onSubmit={handleSubmit}>
                            <div className="mb-3">
                                <label className="form-label">Name:</label>
                                <input
                                    type="text"
                                    className="form-control"
                                    value={name}
                                    placeholder="Your name"
                                    onChange={(e) => setName(e.target.value)}
                                    required
                                />
                            </div>
                            <div className="mb-3">
                                <label className="form-label">Date:</label>
                                <div className="input-group">
                                    <span className="input-group-text">
                                        <i className="bi bi-calendar-event"></i>
                                    </span>
                                    <input
                                        type="date"
                                        className="form-control"
                                        value={date}
                                        onChange={(e) => setDate(e.target.value)}
                                        required
                                    />
                                </div>
                            </div>
                            <fieldset className="mb-3">
                                <legend className="col-form-label pt-0">Select Services:</legend>
                                <div className="row">
                                    {SERVICES.map((service) => (
                                        <div className="col-6" key={service.value}>
                                            <div className="form-check">
                                                <input
                                                    className="form-check-input"
                                                    type="checkbox"
                                                    id={service.value}
                                                    checked={selectedServices.includes(service.value)}
                                                    onChange={() => handleCheckboxChange(service.value)}
                                                />
                                                <label className="form-check-label" htmlFor={service.value}>
                                                    {service.label}
                                                </label>
                                            </div>
                                        </div>
                                    ))}
                                </div>
                            </fieldset>
                            <button type="submit" className="btn btn-success w-100 shadow-sm">
                                Book Appointment
                            </button>
                        </form>
                    </div>
                </div>
            </div>
            <footer className="text-center text-muted py-3">
                &copy; {new Date().getFullYear()} MySite. All rights reserved.
            </footer>
        </div>
    );
};

export default Main;
